  **::.**-- ** The Chase
  President in the distance followed by Endymion
  The four pictures on this and the next page were painted by Henry Williams and depict the incident between HMS Endymion and the
  American ship, The President, on 15th January, 1815. Henry was serving aboard the Endymion at the time and afterwards he was a
  member of the prize crew which sailed the President back to Spithead.
  TAI
  The First Broadside
  President on left, Endymion leaning over having
  fired the first broadside.
